import React, { useState } from 'react';
import { Form, Button, Container, Row, Col, Alert } from 'react-bootstrap';
import ReCAPTCHA from "react-google-recaptcha";

const countries = [    "Afghanistan", "Albania", "Algeria", "Andorra", "Angola", "Antigua and Barbuda", "Argentina", "Armenia",
"Australia", "Austria", "Azerbaijan", "Bahamas", "Bahrain", "Bangladesh", "Barbados", "Belarus", "Belgium",
"Belize", "Benin", "Bhutan", "Bolivia", "Bosnia and Herzegovina", "Botswana", "Brazil", "Brunei", "Bulgaria",
"Burkina Faso", "Burundi", "Cabo Verde", "Cambodia", "Cameroon", "Canada", "Central African Republic", "Chad",
"Chile", "China", "Colombia", "Comoros", "Congo (Congo-Brazzaville)", "Costa Rica", "Croatia", "Cuba", "Cyprus",
"Czechia (Czech Republic)", "Democratic Republic of the Congo", "Denmark", "Djibouti", "Dominica", "Dominican Republic",
"Ecuador", "Egypt", "El Salvador", "Equatorial Guinea", "Eritrea", "Estonia", "Eswatini ", "Ethiopia",
"Fiji", "Finland", "France", "Gabon", "Gambia", "Georgia", "Germany", "Ghana", "Greece", "Grenada", "Guatemala",
"Guinea", "Guinea-Bissau", "Guyana", "Haiti", "Holy See", "Honduras", "Hungary", "Iceland", "India", "Indonesia",
"Iran", "Iraq", "Ireland", "Israel", "Italy", "Jamaica", "Japan", "Jordan", "Kazakhstan", "Kenya", "Kiribati",
"Kuwait", "Kyrgyzstan", "Laos", "Latvia", "Lebanon", "Lesotho", "Liberia", "Libya", "Liechtenstein", "Lithuania",
"Luxembourg", "Madagascar", "Malawi", "Malaysia", "Maldives", "Mali", "Malta", "Marshall Islands", "Mauritania",
"Mauritius", "Mexico", "Micronesia", "Moldova", "Monaco", "Mongolia", "Montenegro", "Morocco", "Mozambique",
"Myanmar (formerly Burma)", "Namibia", "Nauru", "Nepal", "Netherlands", "New Zealand", "Nicaragua", "Niger",
"Nigeria", "North Korea", "North Macedonia (formerly Macedonia)", "Norway", "Oman", "Pakistan", "Palau", "Palestine State",
"Panama", "Papua New Guinea", "Paraguay", "Peru", "Philippines", "Poland", "Portugal", "Qatar", "Romania", "Russia",
"Rwanda", "Saint Kitts and Nevis", "Saint Lucia", "Saint Vincent and the Grenadines", "Samoa", "San Marino",
"Sao Tome and Principe", "Saudi Arabia", "Senegal", "Serbia", "Seychelles", "Sierra Leone", "Singapore", "Slovakia",
"Slovenia", "Solomon Islands", "Somalia", "South Africa", "South Korea", "South Sudan", "Spain", "Sri Lanka",
"Sudan", "Suriname", "Sweden", "Switzerland", "Syria", "Tajikistan", "Tanzania", "Thailand", "Timor-Leste", "Togo",
"Tonga", "Trinidad and Tobago", "Tunisia", "Turkey", "Turkmenistan", "Tuvalu", "Uganda", "Ukraine", "United Arab Emirates",
"United Kingdom", "United States", "Uruguay", "Uzbekistan", "Vanuatu", "Venezuela", "Vietnam", "Yemen",
"Zambia", "Zimbabwe"];

const RegisterPage = () => {
  const [user, setUser] = useState({
    email: '',
    password: '',
    primer_nombre: '',
    segundo_nombre: '', 
    primer_apellido: '',
    segundo_apellido: '', 
    fecha_nacimiento: '', 
    nacionalidad: '',
    pasaporte: '' 
  });
  const [showSuccess, setShowSuccess] = useState(false);
  const [captchaToken, setCaptchaToken] = useState(null); // Estado para almacenar el token de reCAPTCHA

  const handleChange = (e) => {
    setUser({ ...user, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Asegúrate de incluir el token de reCAPTCHA en tu objeto usuarioToSend
    if (!captchaToken) {
      alert("Por favor, verifica que no eres un robot.");
      return;
    }

    const usuarioToSend = {
      ...user,
      rol: 2, // Estableciendo rol predeterminado a 2
      pasaporte: parseInt(user.pasaporte, 10), // Convertir pasaporte a número
      recaptchaToken: captchaToken // Asegúrate de incluir el token de reCAPTCHA
    };

    console.log("Enviando datos al servidor:", JSON.stringify(usuarioToSend));

    try {
      const response = await fetch('http://localhost:8080/usuarios/crear', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      console.log("Respuesta recibida:", response);

      if (!response.ok) {
        // Asegúrate de capturar el cuerpo de la respuesta para más detalles sobre el error
        const errorBody = await response.json();
        console.error('Detalles del error:', errorBody);
        throw new Error('La respuesta de la red no fue ok');
      }

      setShowSuccess(true);
      // Resetear el formulario y el token de reCAPTCHA después del envío exitoso
      setUser({
        email: '',
        password: '',
        primer_nombre: '',
        segundo_nombre: '',
        primer_apellido: '',
        segundo_apellido: '',
        fecha_nacimiento: '',
        nacionalidad: '',
        pasaporte: ''

      });
      setCaptchaToken(null); 
    } catch (error) {
      console.error('Error al enviar datos:', error);
      alert('Error al conectar con el servidor. Por favor, asegúrate de que el servidor esté corriendo y accesible.');
    }
  };




  return (
    <Container className="my-5">
      {showSuccess && <Alert variant="success">Registro exitoso. Por favor inicia sesión.</Alert>}
      <Row className="justify-content-md-center">
        <Col md={6}>
          <h2 className="mb-4">Crear Cuenta</h2>
          <Form onSubmit={handleSubmit}>
            <Form.Group controlId="formBasicEmail">
              <Form.Label>Correo electrónico</Form.Label>
              <Form.Control 
                type="email" 
                placeholder="Ingrese su correo" 
                name="email"
                value={user.email}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicPassword">
              <Form.Label>Contraseña</Form.Label>
              <Form.Control 
                type="password" 
                placeholder="Contraseña" 
                name="password"
                value={user.password}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicFirstName">
              <Form.Label>Primer Nombre</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su primer nombre" 
                name="primer_nombre" 
                value={user.primer_nombre} 
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicSecondName">
              <Form.Label>Segundo Nombre</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su segundo nombre" 
                name="segundo_nombre"
                value={user.segundo_nombre} 
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicLastName">
              <Form.Label>Primer Apellido</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su primer apellido" 
                name="primer_apellido" 
                value={user.primer_apellido} 
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicSecondLastName">
              <Form.Label>Segundo Apellido</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su segundo apellido" 
                name="segundo_apellido" 
                value={user.segundo_apellido} 
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicDateOfBirth">
              <Form.Label>Fecha de Nacimiento</Form.Label>
              <Form.Control 
                type="date" 
                name="fecha_nacimiento" 
                value={user.fecha_nacimiento} 
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicCountry">
              <Form.Label>País de Origen</Form.Label>
              <Form.Select 
                name="nacionalidad"
                value={user.nacionalidad}
                onChange={handleChange}
              >
                <option>Seleccione un país</option>
                {countries.map(country => (
                  <option key={country} value={country}>{country}</option>
                ))}
              </Form.Select>
            </Form.Group>

            <Form.Group controlId="formBasicPassportNumber">
              <Form.Label>Número de Pasaporte</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su número de pasaporte" 
                name="pasaporte"
                value={user.pasaporte}
                onChange={handleChange}
                />
              </Form.Group>

              <ReCAPTCHA
                sitekey="6Lc2g6UpAAAAAJacvQNmo6OvOXyN-hJ2qs3hEkA0"
                onChange={(value) => setCaptchaToken(value)}
              />

              <Button variant="primary" type="submit" className="mt-3" disabled={!captchaToken}>
                Registrarse
              </Button>
            </Form>
          </Col>
        </Row>
      </Container>
    );

};

export default RegisterPage;
